import React from 'react';
import logo from './logo.svg';
import './App.css';
import doggo from './img/doggo.jpg'

function App() {
  return (
    <div className="App">
      <header className="App-header">

        <img src={doggo} className="App-logo" alt="logo" />

        <h2> Wecome to React!</h2>

      </header>
    </div>
  );
}

export default App;
